import styled from 'styled-components';
import theme from '../../../theme/theme';

const HeaderStyled = styled.header`

  div.menu {

    button {
      background-color: none;
      span.squares-menu {
        display: flex;

        div.square {
          height: 15px;
          width: 15px;
          border: 5px solid ${theme.colors.orange};
          border-radius: 7px;
        }
      }
    }
  }
`;

export default HeaderStyled;
